    private static String data;
    private static List<String> availablePages;

    public static boolean isPageAvailable(String pageName){
        if(availablePages == null) parseRawData();
//        int lastSlash = pageName.
        if(pageName == null) return false;
//        if(pageName.length() <= 1) return false;
//        pageName = pageName.substring(1);
//        Out.println("parsed pageName = "+pageName+" is in links? "+availablePages.contains(pageName));
        return availablePages.contains(pageName);
    }

    private static void parseRawData(){
        data = "";
        for(int i = 0; i < dataString.length; i++){
            data += dataString[i];
        }
        Document doc = Jsoup.parse(data);
        availablePages = new ArrayList<>();
        Elements lis = doc.getElementsByTag("li");
        for(Element li : lis){
            availablePages.add(li.attr("data-creature"));
        }
    }

    public static List<String> getAvailablePages(){
        if(availablePages == null) parseRawData();
        return Collections.unmodifiableList(availablePages);
    }

